import { useState } from "react";
import axios from "axios";
import { Button, Typography, Container, Box, Card, CardContent, Grid } from "@mui/material";

const API_URL = "http://127.0.0.1:5000";

const UploadForm = () => {
    const [realEstateFile, setRealEstateFile] = useState(null);
    const [techFile, setTechFile] = useState(null);
    const [carFile, setCarFile] = useState(null);
    const [loading, setLoading] = useState(false);
    const [finalResult, setFinalResult] = useState(null);

    const handleFileChange = (event, type) => {
        if (type === "real_estate") setRealEstateFile(event.target.files[0]);
        if (type === "tech") setTechFile(event.target.files[0]);
        if (type === "car") setCarFile(event.target.files[0]);
    };

    const handleUpload = async () => {
        const formData = new FormData();
        if (realEstateFile) {
            formData.append("files", realEstateFile);
            formData.append("types", "real_estate");
        }
        if (techFile) {
            formData.append("files", techFile);
            formData.append("types", "tech");
        }
        if (carFile) {
            formData.append("files", carFile);
            formData.append("types", "car");
        }

        setLoading(true);
        try {
            const response = await axios.post(`${API_URL}/predict/`, formData, {
                headers: { "Content-Type": "multipart/form-data" }
            });
            console.log("‚úÖ –û—Ç–≤–µ—Ç —Å–µ—Ä–≤–µ—Ä–∞:", response.data);
            setFinalResult(response.data);
        } catch (error) {
            console.error("‚ùå –û—à–∏–±–∫–∞ –ø—Ä–∏ –æ—Ç–ø—Ä–∞–≤–∫–µ:", error);
        }
        setLoading(false);
    };

    return (
        <Container maxWidth="sm">
            <Box textAlign="center" mt={4} p={3} boxShadow={3} borderRadius={2}>
                <Typography variant="h5">–ó–∞–≥—Ä—É–∑–∫–∞ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π</Typography>

                <Typography>üè° –ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "real_estate")} />

                <Typography>üì± –¢–µ—Ö–Ω–∏–∫–∞:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "tech")} />

                <Typography>üöó –ê–≤—Ç–æ–º–æ–±–∏–ª—å:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "car")} />

                <Button variant="contained" color="primary" onClick={handleUpload} disabled={loading}>
                    {loading ? "–†–∞—Å—Å—á–∏—Ç—ã–≤–∞–µ–º..." : "–†–∞—Å—Å—á–∏—Ç–∞—Ç—å"}
                </Button>

                {finalResult && (
                    <Box mt={3}>
                        <Grid container spacing={2}>
                            {finalResult.results.real_estate && (
                                <Grid item xs={12}>
                                    <Card variant="outlined">
                                        <CardContent>
                                            <Typography variant="h6">üè° –ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å</Typography>
                                            <Typography variant="body1"><b>–§–∞–π–ª:</b> {finalResult.files[0]}</Typography>
                                            <Typography variant="body1"><b>YOLO:</b> {finalResult.results.real_estate.yolo.class} ({(finalResult.results.real_estate.yolo.confidence * 100).toFixed(2)}%)</Typography>
                                            <Typography variant="body1"><b>TensorFlow:</b> {finalResult.results.real_estate.tensorflow.class} ({(finalResult.results.real_estate.tensorflow.confidence * 100).toFixed(2)}%)</Typography>
                                            <Typography variant="body2" color="textSecondary">–ò—Å—Ç–æ—á–Ω–∏–∫: YOLO + TensorFlow</Typography>
                                        </CardContent>
                                    </Card>
                                </Grid>
                            )}

                            {finalResult.results.tech && (
                                <Grid item xs={12}>
                                    <Card variant="outlined">
                                        <CardContent>
                                            <Typography variant="h6">üì± –¢–µ—Ö–Ω–∏–∫–∞</Typography>
                                            <Typography variant="body1"><b>–§–∞–π–ª:</b> {finalResult.files[1]}</Typography>
                                            <Typography variant="body1"><b>CLIP:</b> {finalResult.results.tech.clip.class} ({(finalResult.results.tech.clip.confidence * 100).toFixed(2)}%)</Typography>
                                            <Typography variant="body2" color="textSecondary">–ò—Å—Ç–æ—á–Ω–∏–∫: CLIP</Typography>
                                        </CardContent>
                                    </Card>
                                </Grid>
                            )}

                            {finalResult.results.car && (
                                <Grid item xs={12}>
                                    <Card variant="outlined">
                                        <CardContent>
                                            <Typography variant="h6">üöó –ê–≤—Ç–æ–º–æ–±–∏–ª—å</Typography>
                                            <Typography variant="body1"><b>–§–∞–π–ª:</b> {finalResult.files[2]}</Typography>
                                            <Typography variant="body1"><b>ResNet:</b> {finalResult.results.car.resnet.class} ({(finalResult.results.car.resnet.confidence * 100).toFixed(2)}%)</Typography>
                                            <Typography variant="body2" color="textSecondary">–ò—Å—Ç–æ—á–Ω–∏–∫: ResNet</Typography>
                                        </CardContent>
                                    </Card>
                                </Grid>
                            )}

                            <Grid item xs={12}>
                                <Card variant="outlined" sx={{ backgroundColor: "#f0f0f0" }}>
                                    <CardContent>
                                        <Typography variant="h6">üìä –û–±—â–∏–π –∫–ª–∞—Å—Å</Typography>
                                        <Typography variant="h4" fontWeight="bold" color="primary">
                                            {finalResult.final_class}
                                        </Typography>
                                    </CardContent>
                                </Card>
                            </Grid>
                        </Grid>
                    </Box>
                )}
            </Box>
        </Container>
    );
};

export default UploadForm;
